import React from 'react';
import axios from 'axios';

class CurrentPost extends React.Component {

    constructor(props) {
        super(props);

        this.state = {
            newdata: [],
        };
    }


    componentDidMount() {
        // Call our fetch function below once the component mounts
        axios
            .get('http://localhost:5000/getdata')
            .then((response) => {
                console.log(response.data);
                this.setState({ newdata: response.data })
            })
            .catch(function (error) {
                console.log(error);
            });

    }


    render() {
        let x = -1;

        const cards = this.state.newdata.map((val) =>
            <div className="card text-white bg-primary mb-3" key={x++}>
                <div className="card-header"><h5>{val.name}</h5></div>
                <div className="card-body">
                    <p className="card-text">{val.post} </p>
                </div>
            </div>
        )



        return (
            <div className="col-sm text-center">
                <h1>Current Posts:</h1>

                <div className="container">
                    {cards}
                </div>


            </div>
        )

    }

}

export default CurrentPost;
